import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Portfolios.css';

const Portfolios = () => {
  const navigate = useNavigate();

  const handlePortfolioClick = () => {
    navigate('/Portfolioslist');
  };

  const handleCameraInputChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      console.log("File selected: ", file);
      // You can add further processing of the file (e.g., upload it, or use a QR code scanner library)
    }
  };

  return (
    <div className="side-menu">
    <div className="side-menu-content">
        <i 
            className="bi bi-x" 
            style={{ fontSize: "2rem", cursor: "pointer" }} 
            onClick={toggleMenu}
        ></i>
        <div className="menu-header">
            <img 
                src="/profile-picture-placeholder.png" 
                alt="Profile" 
                className="profile-picture"
            />
            <h3>Arjun Patel</h3>
        </div>
        <ul className="menu-items">
            <li onClick={() => handleMenuItemClick('/profile')}>Profile</li>
            <li onClick={() => handleMenuItemClick('/')}>Home</li>
            <li onClick={() => handleMenuItemClick('/scan-qr')}>Scan QR Code</li>
            <li onClick={() => handleMenuItemClick('/sign-out')}>Sign Out</li>
        </ul>
        <div className="menu-footer">
            <img 
                src="/ica-logo.png" 
                alt="ICA Logo" 
                className="img-fluid"
            />
            <p>ITALIAN WOOD FINISHES</p>
        </div>
    </div>
</div>
  );
};

export default Portfolios;
